import React from 'react';

const ColorBox = (props) => {
  return (
    <div >
      {props.colors.map((color, index) => (
        <div
          key={index}
          className="d-flex flex-row w-50 mx-auto aspe"
          style={{ backgroundColor: color}}
        >
          {color}
        </div>
      ))}
    </div>
  );
};

export default ColorBox;
